import React, { useState, useEffect } from 'react';

function App() {
  const [data, setData] = useState({});

  useEffect(() => {
    fetch("https://www.instagram.com/p/CJCrsdPj4i-/?__a=1&max_id=endcursor")
    .then(response => response.json())
    .then(data => setData(data));
  }, [])

  return (
    <div className="App">
      {data.graphql.shortcode_media.map((arr) => {
        return <p></p>;
      })}  
    </div>
  );
}

export default App;
